svg.script:
const now = new Date();
const year = now.getFullYear();
const getText = (month, date) => {
	const day1 = new Date(year, month, 1).getDay();
	return document.getElementById(`d${month + 1}_${day1 + date}`);
}

let holidays = [];


async function dataLoad () {
	const url = "https://www8.cao.go.jp/chosei/shukujitsu/syukujitsu.csv";
	const response = await fetch(url, {mode: "no-cors"});
	const ab       = await response.arrayBuffer();
	const datas    = new TextDecoder("Shift-JIS").decode(ab).split(/\r\n/);
	datas.shift();
	datas.forEach(data => {
		const newData = data.split(",")[0]
		const date = new Date(newData);
		if (date.getFullYear() === year) {
			holidays.push(date);
		}
	});

	console.log(response);
}

function dataWrite () {
	document.getElementById("titleWestern").textContent = `${year}年`;
	document.getElementById("titleJapanese").textContent = now.toLocaleString("ja-JP-u-ca-japanese", {era: "short", year: "numeric"});

	//dates
	for (let m = 0; 12 > m; m++) {
		const month = m + 1
		const length = new Date(year, month, 0).getDate();

		for (let d = 0; length > d; d++) {
			const date = d + 1;
			const Text = getText(m, date);
			Text.textContent = date;

			if (holidays.some(holiday => holiday.getTime() == new Date(year, m, date).getTime())) {
				Text.classList.add("holiday");
			}
		}
	}

}

dataLoad();
setTimeout(dataWrite, 1000);
